import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.css'
import './App.css';

function App() {
  return (
    <Router>
    <div className="App">
      <p className="bg-light">Hello, is it me you're looking for</p>
    </div>
    </Router>
  );
}

export default App;
